    e.preventDefault();
    fetch(`${API_BASE}/users`, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(newUser),
    })
      .then((response) => response.json())
      .then((data) => {
        setUsers([...users, data]);
        setNewUser({
          name: "",
          username: "",
          email: "",
          password: "",
          role: "user",
        });
      })
      .catch((error) => console.error("Feil ved oppretting av bruker:", error));
  };

  // Slett bruker
  const deleteUser = (id) => {
    fetch(`${API_BASE}/users/${id}`, {
      method: "DELETE",
